p_click:
let procedure p_click := {
  now => @com.google.puppeteer(id="com.google.puppeteer").load(url="http://localhost:3000/"^^tt:url);
  now => @com.google.puppeteer(id="com.google.puppeteer").click(frame_url="http://localhost:3000/"^^tt:url, selector="table > tbody > tr:nth-child(1) > td > .button_reserve");
  now => @com.google.puppeteer(id="com.google.puppeteer").click(frame_url="http://localhost:3000/"^^tt:url, selector="table > tbody > tr:nth-child(2) > td > .button_reserve");
} ;

p_email:
let procedure p_email := {
  now => @com.google.puppeteer(id="com.google.puppeteer").load(url="http://localhost:3000/"^^tt:url);
  now => @com.google.puppeteer(id="com.google.puppeteer").set_input(text="hello", frame_url="http://localhost:3000/"^^tt:url, selector="body > input:nth-child(24)");
  now => @com.google.puppeteer(id="com.google.puppeteer").set_input(text="hello [name]", frame_url="http://localhost:3000/"^^tt:url, selector="body > textarea");
  now => @com.google.puppeteer(id="com.google.puppeteer").click(frame_url="http://localhost:3000/"^^tt:url, selector="body > #send");
} ;
